result:
.lan {
  width: 100%;
  height: calc(100vh - 80px);
  background: #eff3ff;
  /* margin-top: 10px; */
  overflow: hidden;
}
.tou{
  width: 100%;
  height: 4vh;
  background: #ffffff;
  line-height: 4vh;
  font-size: 2vh;
}
.tou div{
  display: inline-block;
  margin-left:3%;
  cursor: pointer;
}
.da {
  display: flex;
}
/* devmanagement */
.top {
  width: 98%;
  background: rgba(255, 255, 255, 1);
  box-shadow: 0px 0px 13px 0px rgba(63, 106, 255, 0.08);
  border-radius: 3px;
  padding: 10px;
  margin: 1% 0px 5px 1%;
  border-left: 0.3vw solid #3F6AFF;
}
.top span{
  margin-left: 1%;
  margin-right: 1%;
}
.body{
  width:98%;
  height:80%;
  background:rgba(255,255,255,1);
  box-shadow:0px 0px 13px 0px rgba(63,106,255,0.08);
  border-radius:3px;
  margin-left:14px;
  padding:10px;
  margin-top:15px;
  overflow-x: auto;
}
.body::-webkit-scrollbar {
  /*滚动条整体样式*/
  width : 1px;  /*高宽分别对应横竖滚动条的尺寸*/
  height: 1px;
}
.btn-search,
.car-name-input{
  margin: 0 12px;
}
.btn-search{
  width: 5%;
  height: 4vh;
  background:linear-gradient(90deg,rgba(63,106,255,1) 0%,rgba(109,142,255,1) 100%);
  box-shadow:0px 3px 8px 0px rgba(63,106,255,0.3);
  float: right;
  text-align: center;
  line-height: 4vh;
  font-size: 2vh;
  border-radius: 3vh;
  color: #ffffff;
}
.car-name-input{
  width: 130px;
}
.feny{
  float: right;
  margin-right:10px;
  margin-top:10px;
}
